  <BrowserRouter>
    <Slider />
  </BrowserRouter>,
  document.getElementById('slider')
  );

  // render footer here.....................................................................
  ReactDOM.render(

    <BrowserRouter>
    <Footer />
    </BrowserRouter>,
    document.getElementById('footer')
  );

  // cards attribute data 
  function cData(val){
  return(
  <>
          <div className="col-xl-3 col-lg-3 col-sm-6 col-xs-12">
            <Cards image={val.image} title={val.title}/>
          </div>
  </>
  );
  }
